import React, { useState } from 'react';
import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import CssBaseline from '@material-ui/core/CssBaseline';
import IconButton from '@material-ui/core/IconButton';
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import { Link } from 'react-router-dom';
import './leftbar.css'; // Ensure this path is correct for your CSS
import logo from '../../assets/logo.png'; // Ensure this path is correct for your logo

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
    whiteSpace: 'nowrap',
  },
  drawerOpen: {
    width: drawerWidth,
    transition: theme.transitions.create('width', {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  drawerClose: {
    transition: theme.transitions.create('width', {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    overflowX: 'hidden',
    width: theme.spacing(7) + 1,
    [theme.breakpoints.up('sm')]: {
      width: theme.spacing(9) + 1,
    },
  },
  menuButton: {
    position: 'absolute',
    top: 10,
    left: 10,
    color: 'white',
  }
}));

function LeftBar(props) {
  const classes = useStyles();
  const [open, setOpen] = useState(false);
  const [selectedIndex, setSelectedIndex] = useState(props.tabNav);

  const handleDrawerToggle = () => {
    setOpen(!open);
  };

  const CustomLink = React.forwardRef((linkProps, ref) => (
    <Link ref={ref} {...linkProps} />
  ));

  return (
    <div className={classes.root} id="leftbar">
      <CssBaseline />
      <Drawer
        variant="permanent"
        className={clsx({
          [classes.drawerOpen]: open,
          [classes.drawerClose]: !open,
        })}
        classes={{
          paper: clsx({
            [classes.drawerOpen]: open,
            [classes.drawerClose]: !open,
          }),
        }}
      >
        <div className={classes.toolbar}>
          <IconButton onClick={handleDrawerToggle} className={classes.menuButton}>
            <i className='iconfont icon-tianjiajihua'></i> {/* Toggle icon */}
          </IconButton>
        </div>
        <Divider />
        <List className='navbox'>
          <ListItem button component={CustomLink} className={selectedIndex === 'Programme' ? 'sure' : ''} to="/Programme">
            <i className='iconfont icon-tianjiajihua'></i>
            Programme
          </ListItem>
          <Divider />
          <ListItem button component={CustomLink} className={selectedIndex === 'Modules' ? 'sure' : ''} to="/Modules" >
            <i className='iconfont icon-mokuai'></i>
            Modules
          </ListItem>
          <Divider />
          <ListItem button component={CustomLink} className={selectedIndex === 'CourseWork' ? 'sure' : ''} to="/CourseWork" >
            <i className='iconfont icon-zuoye'></i>
            Course work
          </ListItem>
          <Divider />
          <ListItem button component={CustomLink} className={selectedIndex === 'Exam' ? 'sure' : ''} to="/Exam">
            <i className='iconfont icon-kaoshi'></i>
            Exam
          </ListItem>
          <Divider />
          <ListItem button component={CustomLink} className={selectedIndex === 'Absence' ? 'sure' : ''} to="/Absence">
            <i className='iconfont icon-queqin'></i>
            Absence
          </ListItem>
          <Divider />
          <ListItem button component={CustomLink} className={selectedIndex === 'MyTutor' ? 'sure' : ''} to="/MyTutor">
            <i className='iconfont icon-daoshi'></i>
            My Tutor
          </ListItem>
          <Divider />
          <ListItem button component={CustomLink} className={selectedIndex === 'MyPrograme' ? 'sure' : ''} to="/MyPrograme">
            <i className='iconfont icon-project-o'></i>
            My Programe
          </ListItem>
        </List>
      </Drawer>
    </div>
  );
}

export default LeftBar;
